        id="username"
        onChange={(e) => setUsername(e.target.value)}
        required
      />
      <label for="password">
        <i className="fas fa-lock"></i>
      </label>
      <input
        type="password"
        name="password"
        placeholder="Password"
        onChange={(e) => setPassword(e.target.value)}
        id="password"
        required
      />
      <input type="submit" value="Login" onClick={handleSubmit} />
    </div>
  );
}
